       console.log(rooms);
        return(
          <section className="featured-rooms">
            <Title Title="Featured Rooms"/>
            <div className="featured-rooms-center">
            </div>
            <h1>Hello Here</h1>{rooms}
            </section>
        )
      }
}
export default FeatureRooms;
